import React from 'react';

const Header = () => {
  return (
    <header style={{ backgroundColor: '#3f51b5', color: '#fff', padding: '15px 30px' }}>
      <h1>MeetingBot</h1>
      <p>AI-Powered Meeting Assistant</p>
    </header>
  );
};

export default Header;
